import styled from 'styled-components';

const P = styled.div`
  margin-left: 20px;
  margin-right: 20px;
  margin-bottom: 20px;

  @media screen and (min-width: 1240px) {
    margin-left: 0;
    margin-right: 0;
  }
`;

export default P;
